import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';

function App() {
  return (
      <Router>
      <Navbar />
        <Routes>
          <Route path='/'/>
        </Routes>
      </Router>
  );
}

export default App;
